import React from 'react';
import '../App.css';


function ProjectPreview(props) {
    console.log(props)
    return(
        <figure className="project-preview">
            <img src={process.env.PUBLIC_URL + props.url} className="project-img" alt={props.alt} />
                <h2>{props.name}</h2>
                <h3>{props.role}</h3>
        </figure>
    )
}

export default ProjectPreview;
